import './App.css';
import { Route } from 'react-router-dom';
import Frontpage from './Pages/Frontpage';

function App() {
  return (
    <div className="App">
      <Route path='/' component={Frontpage} />
      <Route path='/chats' />
    </div>);
}

export default App;
